"use strict";(self.webpackChunktemporal_learning=self.webpackChunktemporal_learning||[]).push([[6851],{2958:t=>{t.exports=JSON.parse('{"label":"TypeScript","permalink":"/tags/type-script","allTagsPath":"/tags","count":11,"items":[{"id":"tutorials/typescript/subscriptions/subscription-tutorial","title":"Build a subscription workflow with Temporal and TypeScript","description":"In this tutorial, we will tour all of the Workflow APIs you should know, primarily Signals, Queries, `condition`, and `sleep`, by building a realistic monthly subscription payments workflow that can be canceled and changed while it runs.","permalink":"/tutorials/typescript/subscriptions/"},{"id":"getting_started/typescript/hello_world_in_typescript/hello-world-ts","title":"Build a Temporal Application from scratch in TypeScript","description":"In this tutorial you will build a Temporal Application using the TypeScript SDK. You\'ll write a Workflow, an Activity, and define a Worker.","permalink":"/getting_started/typescript/hello_world_in_typescript/"},{"id":"tutorials/typescript/chatbot/chatbot-tutorial","title":"Choose Your Own Adventure Bot walkthrough in TypeScript","description":"In this tutorial, we\'ll integrate all the knowledge gained from Core and Production APIs in an end-to-end, complete demo application.","permalink":"/tutorials/typescript/chatbot/"},{"id":"tutorials/typescript/nextjs/nextjs-tutorial","title":"Integrating Temporal into an existing Next.js application","description":"Explore how Temporal integrates into an existing Next.js application using Next.js API routes. This gives you the ability to write full-stack, long-running applications end to end in TypeScript.","permalink":"/tutorials/typescript/nextjs/"},{"id":"getting_started/typescript/run_workers_with_cloud_typescript/run-workers-with-cloud-typescript","title":"Run Workers with Temporal Cloud for the TypeScript SDK","description":"In this tutorial, you\'ll learn how to migrate your TypeScript application from a local Temporal Server to a managed Temporal Cloud environment, leveraging the benefits of a scalable and reliable platform for running your Workflows and Activities.","permalink":"/getting_started/typescript/run_workers_with_cloud_typescript/"},{"id":"getting_started/typescript/first_program_in_typescript/run-your-first-app-tutorial-typescript","title":"Run your first Temporal application with the TypeScript SDK","description":"In this tutorial, you\'ll run your first Temporal app using the TypeScript SDK and explore Workflows, Activities, Task Queues, and compensating transactions. Then you\'ll see how Temporal recovers from failures.","permalink":"/getting_started/typescript/first_program_in_typescript/"},{"id":"courses/appdatasec/typescript","title":"Securing Application Data with TypeScript","description":"In this course, you\'ll implement Custom Data Conversion for your Temporal Workflows. By implementing Custom Data Converters and a Codec Server, you can expand this behavior to support a variety of complex input and output data.","permalink":"/courses/appdatasec/typescript"},{"id":"getting_started/typescript/dev_environment/ts-dev-env","title":"Set up a local development environment for Temporal and TypeScript","description":"Set up a local development environment for developing Temporal applications using the TypeScript programming language.","permalink":"/getting_started/typescript/dev_environment/"},{"id":"courses/temporal_101/typescript","title":"Temporal 101 with TypeScript","description":"Discover the essentials of Temporal application development in this course, focusing on Workflows, Activities, and the TypeScript SDK. You\'ll develop a small app, recover from failures, and use Temporal\'s execution model and tools to manage your application lifecycle effectively.","permalink":"/courses/temporal_101/typescript"},{"id":"courses/temporal_102/typescript","title":"Temporal 102: Exploring Durable Execution with TypeScript","description":"Go beyond the basics and gain a deeper understand of how Temporal works as you explore Temporal\'s event history, application lifecycle, write tests, and explore Durable Execution.","permalink":"/courses/temporal_102/typescript"},{"id":"courses/versioning/typescript","title":"Versioning Workflows with TypeScript","description":"In this course, you\'ll go beyond the fundamentals, learning how to safely evolve your Temporal application code in production. There are three primary approaches to versioning Temporal Workflows.","permalink":"/courses/versioning/typescript"}]}')}}]);